    this.state = store.getState()
  }
render(){
  return(
    <div>
      <div>
      <input value={this.state.inputValue}/>
      <button>Submit</button>


      </div>

      <ul>
        <li>Zelda</li>
      </ul>

    </div>
  );
}

}

export default TodoList;
